    _id?: ObjectID
}

class CollectionManager&lt;DataType extends MongodbItem&gt; {
    database: Database;
    collection: Collection&lt;DataType&gt;;
    // ...
    async get(id?: ObjectID) {
        if (!id) return await this.collection.find({}).toArray();
        return await this.collection.findOne({ _id: id });
    }
}

</code></pre>
