How to upload and retrieve images in mognoose with multer file references<p>I'm trying to save images in a django style way, where the image gets saved to a folder and the path to the file is returned in a get request.</p>
<p>So far I have the following Picture model:</p>
<pre><code>const PictureSchema = new mongoose.Schema(
  {
    image: {
      type: String,
      required: true,
    },
  },
  {
    timestamps: true,
  }
);

module.exports = mongoose.model(&quot;Picture&quot;, PictureSchema);

</code></pre>
<p>And the following views:</p>
<pre><code>const storage = multer.diskStorage({
  destination: (req, file, cb) =&gt; {
    cb(null, &quot;data/images&quot;);
  },
  filename: function (req, file, cb) {
    cb(null, Date.now() + &quot;.jpg&quot;);
  },
});

const upload = multer({ storage: storage });

app.post(&quot;/upload&quot;, upload.single(&quot;image&quot;), (req, res) =&gt; {
  Picture.create({
    image: req.file.path,
  })
    .then((picture) =&gt; res.status(201).json(picture))
    .catch((err) =&gt; res.status(500).json({ error: err.message }));
});

app.get(&quot;/&quot;, (req, res) =&gt; {
  Picture.find({}, &quot;-__v&quot;)
    .then((pictures) =&gt; res.status(200).json(pictures))
    .catch((err) =&gt; res.status(500).json({ error: err.message }));
});
</code></pre>
<p>Everything works, the file gets saved to a folder and when I retrieve it shows up like:</p>
<pre><code>{
    &quot;_id&quot;: &quot;5fd0f1d4f81e3f28b0aa70d3&quot;,
    &quot;image&quot;: &quot;data\\images\\1607528916952.jpg&quot;,
    &quot;createdAt&quot;: &quot;2020-12-09T15:48:36.967Z&quot;,
    &quot;updatedAt&quot;: &quot;2020-12-09T15:48:36.967Z&quot;,
    &quot;__v&quot;: 0
}
</code></pre>
<p>But I have express set up to serve the static directory like:</p>
<pre><code>app.use(express.static(&quot;data&quot;));
</code></pre>
<p><a href="https://i.stack.imgur.com/teaMk.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/teaMk.png" alt="file screenshot" /></a></p>
<p>How do I get it to return the instance with the relative path to the image field instead of the relative path from within the file system?</p>

